import { Facebook, LinkedIn } from "@mui/icons-material";

export const navbarLinks = [
  {
    to: "/",
    name: "Home",
    onClick: () => alert("pressed"),
  },
  {
    to: "/",
    name: "Case Study",
    onClick: () => alert("pressed"),
  },
  {
    to: "/",
    name: "Portfolio",
    onClick: () => alert("pressed"),
  },
  {
    to: "/",
    name: "Blogs",
    onClick: () => alert("pressed"),
  },
  {
    to: "/",
    name: "Contact",
    onClick: () => alert("pressed"),
  },
];

export const socialLinks = [
  {
    to: "/",
    icon: <Facebook sx={{color: '#fff'}} />,
    onClick: () => alert("pressed"),
  },
  {
    to: "/",
    icon: <LinkedIn />,
    onClick: () => alert("pressed"),
  },
];
